class TodoForm extends Component{
    constructor(props) {
        super(props);
        this.state={inputValue: ''};
    }


    render() {
        return(
            <div>
                <input type="text"/>
                <button>your love story</button>
            </div>
        )
    }
}
export default TodoForm;
